      gifImage: "path/to/login-demo.gif"
    },
    {
      description: "Step 2: User Login and qdsflkj fd lmqfdl qjsdflmkj qdlmjf qlmsjkdflmkqj fdj fdDashboard Overview",
      gifImage: "path/to/login-demo.gif"
    },
    {
      description: "Step 2: User Login qdsfk q flhsjlqsdfmfjqsd lfjlmdjf lmdsjqfqlfj mlqsjdf lmqjfdlmkq flmdkjf lmqjkdflmkqjfd lmqjdsflmkj fdqlmjfd land Dashboard Overview",
      gifImage: "path/to/login-demo.gif"
    },
    {
      description: "Step 2: User qdfkj mlqjdfslmk qjdflmjq flmdjqlmk dsjflmqjd flmjqdflkmj qlmdkfjlmjLogin and Dashboard Overview",
      gifImage: "path/to/login-demo.gif"
    }
  ],
};

const Project = () => {
  const { title, websiteLink, githubLink, demoLink, description, demonstration } = dummyData;

  return (
    <GlobalStyles>
    <GradientBackground startColor="#0A2647" endColor="#0C356A">
      <Card>
        <ProjectContainer>
          <FlexRow>
            <TextMod size="2.5rem" font="Verdana, sans-serif" weight="bold"><GradientText startColor="#00AD7C" endColor="#03C988">{title}</GradientText></TextMod>
             
            <LinksContainer>

            <GlowingButton bgColor="#00DFA2" bgColorChange="E8FFCE" TextColor="#E8FFCE" hoverTextColor="00DFA2">
  Click me!
</GlowingButton>

             
            </LinksContainer>
            <FloatingElement>
              <CircleExpand>ðŸ”µ</CircleExpand>
            </FloatingElement>
          </FlexRow>

        

        

           
         
           

           
         

          <GlassCard hoverColor="white" >
          <FlexContainer>
                <GrowVerticalLine></GrowVerticalLine>
              <Description>
            <TextMod size="3.2rem" color="#E1E5EA" font="Robboto, sans-serif" weight="500" >
                <LineHeightText lineHeight="1.6">
                  <FlexContainer>
      <h5>description</h5>
      <GrowHorizontalLine></GrowHorizontalLine>
    </FlexContainer>
    </LineHeightText>

    

              </TextMod>
              


              <TextMod size="1.2rem" color="#9DB2BF" font="Verdana, sans-serif" weight="500" >
                <LineHeightText lineHeight="1.6"><p>{description}</p></LineHeightText>
              </TextMod>

              
            </Description>
            </FlexContainer>
          </GlassCard>
          <GlowingLine lineColor="#00DFA2" shadowColor="#00DFA2" />


          {demonstration && (
            <DemonstrationContainer show="true" >
              <GlassCard>
                <Subtitle><h5>Demonstration:</h5></Subtitle>
                <StepsContainer>
                  {demonstration.map((step, index) => (
                    <StepItem key={index}>
                      <StepDescription>
                        <TextMod type="italic" color="#DADADA" ><p>{step.description}</p></TextMod>
                      </StepDescription>
                      <GifContainer>
                        <GifImage src={step.gifImage} alt={`Demo for step ${index + 1}`} />
                      </GifContainer>
                    </StepItem>
                  ))}
                </StepsContainer>
              </GlassCard>
            </DemonstrationContainer>
          )}
        </ProjectContainer>
      </Card>
      <GradientIconFill>ðŸŒŸ</GradientIconFill>
      <ExpandingBorderInput placeholder="Type here..." />
    </GradientBackground>
    </GlobalStyles>
  );
};

export default Project;
